import React from 'react'
import darkMode from './img/night-mode.png'

const Header = () => {
  return (
    <div style={{display: 'flex', alignItems: 'center'}}>
        <h3>Gabriel Ghiaroni</h3>
        <h3>Home</h3>
        <h3>Skills</h3>
        <h3>Portfolio</h3>
        <h3>Contato</h3>
        <img src={darkMode} style={{width: '24px', height: '24px'}}/>
    </div>
  )
}

export default Header;
